import React from "react";

function PrintLines({ selectedLines }) {
  // Sort the selectedLines array in ascending order based on the value
  const sortedLines = [...selectedLines].sort((a, b) => a.value - b.value);

  return (
    <div className="flex">
      {sortedLines.map((line, index) => (
        <div key={index} className={`${line.level} lineItem`}>
          {line.value}
        </div>
      ))}
    </div>
  );
}

export default PrintLines;
